import React from 'react';
import './CSS/Nav.css'

export default class Nav extends React.Component{
    render(){
        return(
            <div className="nav-container">
                <div className="">
                    <h1>Anas Alam</h1>
                    <nav>
                        <ul className='nav-ul'>
                            <li>
                            <a href='/'>Home</a> 
                            </li>
                            <li>
                                <a href='/projects'>Projects</a>
                            </li>
                            <li>
                                <a href='/contact'>Contact</a>
                            </li>
                        </ul>
                    </nav>
                </div>
            </div>
        );
    }
}
